(238, 1, 'admin/blogs', 'POST', '127.0.0.1', '{\"title\":\"flower end-year\",\"name\":\"linh\",\"time\":\"10:43:52\",\"date\":\"2023-12-12\",\"content\":\"Ng\\u00e0y 12.11, T\\u1ed5ng B\\u00ed th\\u01b0, Ch\\u1ee7 t\\u1ecbch Trung Qu\\u1ed1c T\\u1eadp C\\u1eadn B\\u00ecnh v\\u00e0 Phu nh\\u00e2n B\\u00e0nh L\\u1ec7 Vi\\u00ean b\\u1eaft \\u0111\\u1ea7u chuy\\u1ebfn th\\u0103m c\\u1ea5p nh\\u00e0 n\\u01b0\\u1edbc \\u0111\\u1ebfn Vi\\u1ec7t Nam t\\u1eeb ng\\u00e0y 12-13.12.  Chuy\\u1ebfn th\\u0103m c\\u1ee7a T\\u1ed5ng B\\u00ed th\\u01b0, Ch\\u1ee7 t\\u1ecbch Trung Qu\\u1ed1c T\\u1eadp C\\u1eadn B\\u00ecnh v\\u00e0 Phu nh\\u00e2n B\\u00e0nh L\\u1ec7 Vi\\u00ean di\\u1ec5n ra theo l\\u1eddi m\\u1eddi c\\u1ee7a T\\u1ed5ng B\\u00ed th\\u01b0 Nguy\\u1ec5n Ph\\u00fa Tr\\u1ecdng v\\u00e0 Phu nh\\u00e2n, Ch\\u1ee7 t\\u1ecbch n\\u01b0\\u1edbc V\\u00f5 V\\u0103n Th\\u01b0\\u1edfng v\\u00e0 Phu nh\\u00e2n.  \\u0110\\u00e2y l\\u00e0 l\\u1ea7n th\\u1ee9 2, Phu nh\\u00e2n B\\u00e0nh L\\u1ec7 Vi\\u00ean t\\u1edbi Vi\\u1ec7t Nam trong vai tr\\u00f2 Phu nh\\u00e2n T\\u1ed5ng B\\u00ed th\\u01b0, Ch\\u1ee7 t\\u1ecbch n\\u01b0\\u1edbc Trung Qu\\u1ed1c sau chuy\\u1ebfn th\\u0103m c\\u1ea5p nh\\u00e0 n\\u01b0\\u1edbc t\\u1edbi Vi\\u1ec7t Nam c\\u1ee7a T\\u1ed5ng B\\u00ed th\\u01b0, Ch\\u1ee7 t\\u1ecbch T\\u1eadp C\\u1eadn B\\u00ecnh v\\u00e0 Phu nh\\u00e2n B\\u00e0nh L\\u1ec7 Vi\\u00ean v\\u00e0o th\\u00e1ng 11.2015.\",\"_token\":\"bbFWrTjpBYLoPcKK3lHL33HRqI9SQOhJTpO0yjbF\"}', '2023-12-12 03:45:46', '2023-12-12 03:45:46'),
