(251, 1, 'admin/blogs', 'POST', '127.0.0.1', '{\"title\":\"end year 2003 party\",\"name\":\"linh\",\"time\":\"11:48:53\",\"date\":\"2023-12-12\",\"content\":\"Gi\\u00e1o s\\u01b0 B\\u00e0nh L\\u1ec7 Vi\\u00ean sinh n\\u0103m 1962, l\\u00e0 Thi\\u1ebfu t\\u01b0\\u1edbng Qu\\u00e2n gi\\u1ea3i ph\\u00f3ng nh\\u00e2n d\\u00e2n Trung Qu\\u1ed1c, Gi\\u00e1m \\u0111\\u1ed1c H\\u1ecdc vi\\u1ec7n Ngh\\u1ec7 thu\\u1eadt Qu\\u00e2n \\u0111\\u1ed9i, Phu nh\\u00e2n T\\u1ed5ng B\\u00ed th\\u01b0, Ch\\u1ee7 t\\u1ecbch n\\u01b0\\u1edbc Trung Qu\\u1ed1c T\\u1eadp C\\u1eadn B\\u00ecnh. Gi\\u00e1o s\\u01b0 B\\u00e0nh L\\u1ec7 Vi\\u00ean l\\u00e0 ca s\\u0129 gi\\u1ecdng n\\u1eef cao n\\u1ed5i ti\\u1ebfng c\\u1ee7a Trung Qu\\u1ed1c, l\\u00e0 \\u0111\\u1ea1i di\\u1ec7n ti\\u00eau bi\\u1ec3u v\\u00e0 l\\u00e0 th\\u1ea1c s\\u0129 \\u0111\\u1ea7u ti\\u00ean c\\u1ee7a d\\u00f2ng thanh nh\\u1ea1c d\\u00e2n gian \\u0111\\u01b0\\u01a1ng \\u0111\\u1ea1i Trung Qu\\u1ed1c.\",\"_token\":\"bbFWrTjpBYLoPcKK3lHL33HRqI9SQOhJTpO0yjbF\"}', '2023-12-12 03:49:41', '2023-12-12 03:49:41'),
