(1985, 1, 'admin/products', 'POST', '127.0.0.1', '{\"product_id\":\"P180\",\"product_name\":\"Wedding flowers The sound of love\",\"product_price\":\"250\",\"product_quantity\":\"1000\",\"product_description\":\"In life, there are many special moments, but nothing can compare to the moment he confessed his love or proposed to the person he loves. At that time, the woman\'s ultimate happiness was conveyed and they both shared a memorable moment. It was from that moment that the design of the wedding bouquet \\\"The Voice of Love\\\" was inspired.\\r\\n\\r\\nThis bouquet is deeply romantic and passionate, but still retains the gentleness and gentleness of women. It is a perfect choice to express your love and affection on your wedding day. With the \\\"Love Voice\\\" wedding bouquet, you will shine brighter than ever and become special and precious in the eyes of the person you love.\\r\\n\\r\\nChoose the \\\"Sound of Love\\\" wedding bouquet to create elegance and sophistication for your wedding.\",\"category_id\":\"C02\",\"_token\":\"b7httkf5XYifChKYDMHzp4dYzzkylEcVBQ1ZapUx\"}', '2024-01-01 12:40:47', '2024-01-01 12:40:47'),
