(1988, 1, 'admin/products', 'POST', '127.0.0.1', '{\"product_id\":\"P181\",\"product_name\":\"Wedding flowers Love\",\"product_price\":\"430\",\"product_quantity\":\"1000\",\"product_description\":\"Spring is budding, the delicate white scent of the bouquet of roses held in your hand in the sunny garden is bringing a gentle, sweet atmosphere. The birds chirping overhead, all creating a romantic and gentle scene, with only us walking side by side. With this bouquet of roses, my love for you is overwhelming and all becomes clear through its magical beauty.\\r\\n\\r\\nChoose the \\\"Green Blue\\\" wedding bouquet to create elegance and sophistication for your wedding.\",\"category_id\":\"C02\",\"_token\":\"b7httkf5XYifChKYDMHzp4dYzzkylEcVBQ1ZapUx\"}', '2024-01-01 12:43:20', '2024-01-01 12:43:20'),
