INSERT INTO `productflower` (`product_id`, `image`, `product_name`, `product_price`, `product_quantity`, `product_description`, `category_id`, `created_at`, `updated_at`) VALUES
('P100', 'images/hoasinhnhat100.jpg', 'Possibly Pink', 69, 1000, 'Peach, pink and lavender blooms are a sweet and innocent way to show your affection. Boasting a beautiful variety of flowers, this chic bouquet of feminine colors is full of texture and makes a fabulous gift. A stylish pink glass cube vase features feminine flowers including peach roses, pink asiatic lilies, pink carnations, lavender cushion mums and lavender waxflower. Variegated pittosporum and seeded eucalyptus add a touch of green.', 'C04', '2024-01-01 03:41:54', '2024-01-01 03:41:54'),
('P101', 'images/hoasinhnhat101.jpg', 'Enchanting Blue Bouquet', 74, 1000, 'Soft as a whisper, this enchanting bouquet of cream and pink roses looks oh-so-lovely in a cobalt blue glass cube that later becomes a comely candleholder. Crème roses, pink spray roses, white alstroemeria and miniature white carnations are arranged with variegated pittosporum, dusy miller, white sinuata statice and a large, potted green echeveria succulent.', 'C04', '2024-01-01 03:43:25', '2024-01-01 03:43:25'),
('P102', 'images/hoasinhnhat102.jpg', 'Country Basket Blooms', 79, 1000, 'Take a walk through a country meadow with this fresh flower basket! Pretty blooms of pink and purple nestle happily inside a natural gift basket as playful purple butterflies flutter overhead. Fresh flowers including snapdragons, alstroemeria, mini carnations and matsumoto asters are assembled in a natural basket with decorative butterflies.', 'C04', '2024-01-01 03:44:05', '2024-01-01 03:44:05'),
('P103', 'images/hoasinhnhat103.jpg', 'Birthday Greetings Bouquet', 79, 1000, 'Send extra special birthday greetings with this perfect pink bouquet! Its beautiful blooms are artfully arranged in a frosted glass bowl with hand-painted candles--what a treat! Pink roses, purple stock, dark pink carnations, lavender cushion spray chrysanthemums, miniature lavender carnations and purple sinuata statice are arranged with variegated pittosporum and lemon leaf.', 'C04', '2024-01-01 03:44:43', '2024-01-01 03:44:43'),
('P104', 'images/hoasinhnhat104.jpg', 'Blossoms in Vogue', 94, 1000, 'High-fashion flowers for the style-minded! This modern presentation of multicolored roses and green hydrangea has a tropical feel thanks to the hot color palette and the aspidistra leaves in the vase. Bright green hydrangea and rich green salal leaves mix with hot pink, yellow, and orange bi-color roses in a clear glass cylinder that\'s lined with variegated aspidistra leaves.', 'C04', '2024-01-01 03:45:18', '2024-01-01 03:45:18'),
('P105', 'images/hoasinhnhat105.jpg', 'Beautiful in Blue', 79, 1000, 'Brighten the home with the peace and beauty of a bright blue sky. This beautiful bouquet with pure white flowers in a gorgeous blue glass vase. Beautiful blooms such as crème roses, white lilies and alstroemeria along with white chrysanthemums, eucalyptus, limonium and more are beautifully arranged in a dazzling cobalt blue vase.', 'C04', '2024-01-01 03:46:05', '2024-01-01 03:46:05'),
('P106', 'images/hoasinhnhat106.jpg', 'Time To Celebrate Bouquet', 84, 1000, 'Bursting with birthday cheer! This colorful, confetti-covered ceramic mug brightens their special day with beautiful blooms, then cheers them up as a food-safe mug for sipping yummy drinks all year long! This fun bouquet features peach roses, pink matsumoto asters, green button spray chrysanthemums, dark pink carnations, variegated pittosporum, lemon leaf and seeded eucalyptus.', 'C04', '2024-01-01 03:46:50', '2024-01-01 03:46:50'),
('P107', 'images/hoasinhnhat107.jpg', 'Silver Splendor Bouquet', 79, 1000, 'Presented in a shimmering silver moonstone glass vase, this feminine pink rose bouquet is a breathtaking reminder of how much you care! This pretty bouquet includes light pink roses, pink spray roses, white alstroemeria, green cushion spray chrysanthemums, white sinuata statice, dusty miller and huckleberry.', 'C04', '2024-01-01 03:47:29', '2024-01-01 03:47:29'),
('P108', 'images/hoasinhnhat108.jpg', 'Smile for Me', 69, 1000, 'Show your romantic side by sending this gorgeous bouquet of hot pink roses, orange spray roses and other fabulous faves in a charming glass bubble bowl. She\'ll love the gift, and you for having such amazingly good taste. This enchanting bouquet includes hot pink roses, orange spray roses, green button spray chrysanthemums, purple carnations and bupleurum.', 'C04', '2024-01-01 03:48:07', '2024-01-01 03:48:07'),
('P109', 'images/hoasinhnhat109.jpg', 'Full Of Love Bouquet', 64, 1000, 'It\'s beauty-full! Bursting with tantalizing tulips and radiant roses, this delightful pink arrangement brings spring joy to that special someone. Includes pink roses, tulips, carnations and waxflower, accented with fresh pitta negra and variegated pittosporum.', 'C04', '2024-01-01 03:48:57', '2024-01-01 03:48:57'),
('P110', 'images/hoasinhnhat110.jpg', 'Spread Sunshine Bouquet', 79, 1000, 'Spread sunshine with bold roses, cheerful lilies, and fluttering alstroemerias in this stylish Color Splash cube. It\'ll brighten anyone\'s day with a burst of fun, colorful blooms. This bouquet features hot pink roses, yellow spray roses, orange lilies, yellow alstroemeria, and miniature hot pink carnations. Hand-delivered in Teleflora\'s Color Splash cube.', 'C04', '2024-01-01 03:49:36', '2024-01-01 03:49:36'),
('P13', 'images/hoa1.jpg', 'My Darling', 67, 1000, 'Roses are a meaningful gift for any occasion, and the fresh flower basket \"My Darling\" is the right choice.', 'C03', '2023-12-18 09:50:42', '2024-01-01 09:22:23'),
('P14', 'images/hoa2.jpg', 'Memories', 30, 1000, 'The fresh flower basket \"Memories\" carries a sweet pink hue, with the combination of pink roses and purple lavender. They delicately and gently bring forth a performance of a romantic love song that feels incredibly sweet, even without any added sugar.', 'C03', '2023-12-18 09:51:28', '2024-01-01 09:23:09'),
('P15', 'images/hoa3.jpg', 'Warm Sunlight', 25, 1000, 'The fresh flower bouquet \"Warm Sunlight\" contains the meaningful messages of warm sunlight, which is a gift that we want to give to you. We hope that even if the path ahead may be dark and unclear, you can still find your own ray of hopeful light.', 'C03', '2023-12-18 09:52:25', '2024-01-01 09:24:10'),
('P16', 'images/hoa4_1.jpg', 'Sunny Day', 27, 1000, '\"Sunny Day\" is a special fresh flower bouquet from our shop because it not only possesses an attractive appearance with the refreshing green color of the wrapping paper but also evokes a sense of nostalgia with the vibrant and warm yellow hue of sunflowers intermingled with the dreamy purple shade of lavender.', 'C03', '2023-12-18 09:53:14', '2024-01-01 09:25:18'),
('P17', 'images/hoa5_1.jpg', 'Precious Moment', 21, 1000, 'A wonderful gift is not only beautiful on the outside but also holds deep mysteries behind it. The fresh flower bouquet \"Precious Moment\" from our shop will be a meaningful gift of fresh flowers to give to yourself or your loved ones.', 'C03', '2023-12-18 09:54:55', '2024-01-01 09:26:39'),
('P18', 'images/hoa6.jpg', 'Love Song', 31, 1000, 'The overall fresh flower bouquet \"Love Song\" is a vibrant painting of red roses symbolizing intense and passionate love. Each fresh petal carries that bright color like an 18-year-old maiden, who desires passionate love yet also exhibits a hint of shyness nestled among the green leaves. Moreover, the bouquet becomes even more beautiful when adorned with a black outer wrapping, creating a captivating and enchanting overall appearance.', 'C03', '2023-12-18 09:55:51', '2024-01-01 09:27:34'),
('P19', 'images/hoasinhnhat1.jpg', 'Color of Love', 33, 1000, 'Everyone is captivated by the alluring and sweet beauty of roses, and people often refer to the color of roses as the color of love. Would you like to send a little sweetness to your loved one?', 'C04', '2023-12-18 09:26:59', '2024-01-01 09:29:07'),
('P20', 'images/hoasinhnhat2.jpg', 'Burning Passion', 50, 1000, '\"Burning Passion\" is a vibrant and radiant fresh flower bouquet available on our flower shelf. \"Burning Passion\" attracts viewers with its dazzling yet elegant appearance. It leaves a strong impression with its vibrant and pure shades of pink and red.', 'C04', '2023-12-18 09:27:56', '2024-01-01 09:31:06'),
('P21', 'images/hoasinhnhat3.jpg', 'Delighted', 52, 1000, 'With yellow and green as the dominant colors, this flower arrangement is incredibly impressive and captivating. If you appreciate the gentle beauty of the sunrise, when the morning dew lingers and the sun is not too harsh, then you should choose a delicate flower arrangement for yourself. Don\'t hesitate any longer, the blossoming petals of the Delighted Fresh Flower Basket are waiting for you to cherish and love.', 'C04', '2023-12-18 09:29:11', '2024-01-01 09:31:46'),
('P22', 'images/hoasinhnhat4.jpg', 'Elegant and Stylish', 47, 1000, 'From the very first glance, the \"Elegant and Stylish\" desktop flower arrangement exudes an exquisite beauty, like a princess stepping out of her castle. It is both grand and sophisticated while still retaining the inherent grace of a woman.', 'C04', '2023-12-18 09:29:58', '2024-01-01 09:30:50'),
('P23', 'images/hoasinhnhat5.jpg', 'Boundless Happiness', 87, 1000, 'There is a story about a charming and adorable lady, with rosy red lips and a lovely demeanor. She has two friends: a delicate and warm orchid with a gentle beauty, and a deep red poppy with luscious red lips. They all grew up together in a small, adorable wicker basket. The green leaves whispered to the basket, \"Who is the most beautiful among us?\" The wooden box grinned and said, \"I don\'t know who is the most beautiful, but I know I am the most wonderful, a part of the Boundless Happiness Fresh Flower Basket.\" Beauty, sometimes, is not defined by the prominence of an individual, but by the harmonious entirety of every line and contour.', 'C04', '2023-12-18 09:31:35', '2024-01-01 09:33:19'),
('P24', 'images/hoasinhnhat6.jpg', 'White Orchid Butterfly', 30, 1000, 'White orchids are pure and exude an elegant, graceful, and captivating charm, making them perfect for decorating upscale restaurants and high-end hotels.', 'C04', '2023-12-18 09:32:50', '2024-01-01 09:34:59'),
('P26', 'images/hoa7.jpg', 'Happy Bouquet', 60, 1000, 'Happiness, delivered! Colorful roses in a cheerful ceramic mug are the quickest way to turn any day into a GREAT day. Hot pink roses, orange spray roses, lavender matsumoto asters, green button spray chrysanthemums, yellow cushion spray chrysanthemums and lavender sinuata statice are arranged with huckleberry and pitta negra.', 'C03', '2023-12-31 21:05:27', '2023-12-31 22:38:10'),
('P27', 'images/hoa8_1.jpg', 'Soft Reflections Bouquet', 75, 1000, 'Soft, sunshiny blooms and a sparkling silver vase combine to striking effect in this magnificent bouquet. Its yellow and peach roses and keepsake vase are sure to make them smile, no matter the occasion! This soft mix of yellow roses, light yellow spray roses, peach spray roses, yellow alstroemeria, crème carnations and peach stock is accented with spiral and seeded eucalyptus.', 'C03', '2023-12-31 22:36:06', '2023-12-31 22:36:22'),
('P28', 'images/hoa9_1.jpg', 'Thrilled For You Bouquet', 55, 1000, 'Time to celebrate! Make any occasion feel extra special with this heartfelt gift of lavender and hot pink roses, hand-delivered in a gorgeous golden cube with cutout design. Remove the pretty purple liner and \"celebrate\" pick to transform this shimmering vase into a glowing candleholder! Lavender roses, hot pink spray roses, purple stock, and lavender carnations are arranged with spiral eucalyptus and lemon leaf.', 'C03', '2023-12-31 22:39:34', '2024-01-01 07:38:38'),
('P29', 'images/hoa10.jpg', 'Shine In Style Bouquet', 70, 1000, 'Mother\'s Day is sure to shine when you surprise Mom with this luxurious gift of lavender and pink blooms arranged in a stunning iridescent mosaic glass vase. This gorgeous bouquet features pink roses, lavender alstroemeria, lavender carnations, purple daisy spray chrysanthemums, seeded eucalyptus, and lemon leaf. Delivered in Teleflora\'s Shine in Style Cylinder.', 'C03', '2023-12-31 22:40:40', '2023-12-31 22:40:40'),
('P30', 'images/hoa11.jpg', 'Spread Sunshine Bouquet', 80, 1000, 'Spread sunshine with bold roses, cheerful lilies, and fluttering alstroemerias in this stylish Color Splash cube. It\'ll brighten anyone\'s day with a burst of fun, colorful blooms. This bouquet features hot pink roses, yellow spray roses, orange lilies, yellow alstroemeria, and miniature hot pink carnations. Hand-delivered in Teleflora\'s Color Splash cube.', 'C03', '2023-12-31 22:41:40', '2023-12-31 22:41:40'),
('P31', 'images/hoa12.jpg', 'Wondrous Wishes', 95, 1000, 'Featuring a wide, wondrous assortment of blooms in one bouquet, this colorful arrangement is always a favorite! Hydrangea, roses, lilies, alstroemeria, gerberas, daisies - they\'re all here in stunning variety. This versatile mix includes blue hydrangea, orange roses, light pink asiatic lilies, pink alstroemeria, hot pink gerberas and purple daisies with a bit of rich green salal.', 'C03', '2023-12-31 22:42:36', '2023-12-31 22:42:36'),
('P32', 'images/hoa13.jpg', 'Stained Glass Blooms Bouquet', 85, 1000, 'Soft and sweet, the beauty of this stunning springtime bouquet is matched only by its spectacular stained-glass inspired mosaic vase! This alluring bouquet features lavender roses, light yellow spray roses, pink alstroemeria, pink miniature carnations, light blue delphinium, bupleurum, dusty miller, and lemon leaf.', 'C03', '2023-12-31 22:44:15', '2023-12-31 22:44:15'),
('P33', 'images/hoa14.jpg', 'Precious Jewel Bouquet', 79, 1000, 'Joyful roses and gerberas bring happiness wherever they go! Especially when presented in this stunning mosaic glass vase with shimmering iridescent finish. Orange spray roses, miniature peach gerberas, pink carnations and miniature pink carnations are arranged with dusty miller and pitta negra.', 'C03', '2023-12-31 22:46:30', '2023-12-31 22:46:30'),
('P34', 'images/hoa15.jpg', 'Precious Pink Bear Bouquet', 89, 1000, 'Beary sweet! Celebrate her special arrival with this precious pink and crème rose bouquet, delivered in a delightful ceramic teddy bear. This precious bouquet includes crème roses, pink spray roses, pink alstroemeria, pink miniature carnations, bupleurum, dusty miller, and leatherleaf fern.', 'C03', '2023-12-31 22:48:43', '2023-12-31 22:48:43'),
('P35', 'images/hoa16.jpg', 'Bee Delighted Bouquet', 89, 1000, 'This delightful bouquet includes peach roses, pink spray roses, pink gerberas, yellow miniature carnations, raspberry sinuata statice, parvifolia eucalyptus, dusty miller, and lemon leaf. Who could help but \"bee delighted\" by this sweet surprise! Bursting with spring-fresh pink and peach blooms, this charming country-inspired ceramic pitcher is sure to be a favorite food-safe keepsake!', 'C03', '2023-12-31 22:49:39', '2023-12-31 22:49:39'),
('P36', 'images/hoa17.jpg', 'Magical Garden Unicorn Bouquet', 80, 1000, 'Make magic with this joyful gift of peach and pink roses, delicately arranged in this sweet ceramic unicorn keepsake that\'s hand-painted for an extra-special touch! Peach roses, pink spray roses, white alstroemeria, peach miniature carnations, blue sinuata statice, and pink waxflower are accented with huckleberry and pitta negra.', 'C03', '2023-12-31 22:50:32', '2023-12-31 22:50:32'),
('P37', 'images/hoa18.jpg', 'Welcome Little One Bouquet', 75, 1000, 'A little arrival deserves a big welcome! Celebrate a new life with this luxurious bouquet of roses, mums and delphinium, hand-delivered in a darling glass baby block keepsake cube. White roses, white alstroemeria, yellow button spray chrysanthemums, and blue delphinium are arranged with bupleurum, dusty miller, and leatherleaf fern.', 'C03', '2023-12-31 22:51:51', '2023-12-31 22:51:51'),
('P38', 'images/hoa19.jpg', 'Enchanting Pastels Unicorn Bouquet', 74, 1000, 'Pure enchantment! This sweet ceramic unicorn with hand-painted details can\'t wait to share this pretty pastel bouquet with your someone special! This enchanting arrangement features light pink roses, purple alstroemeria, light blue delphinium, white button spray chrysanthemums, pink sinuata statice, and huckleberry.', 'C03', '2023-12-31 22:52:45', '2023-12-31 22:52:45'),
('P39', 'images/hoa20.jpg', 'Spring In The Countryside Bouquet', 80, 1000, 'Springtime perfection! Celebrate the season with pretty pink and pale green blooms, artfully arranged in a country-inspired ceramic pitcher that\'s food-safe and finished with a subtle iridescent glaze. This charming bouquet features hot pink roses, green carnations, miniature pink carnations, raspberry sinuata statice, lavender cushion spray chrystanthemums, huckleberry, seeded eucalyptus and pitta negra.', 'C03', '2024-01-01 02:02:43', '2024-01-01 02:03:32'),
('P40', 'images/hoa21.jpg', 'First Block - Blue', 75, 1000, 'He\'ll be building block towers soon enough! For now, celebrate him with this beautiful keepsake baby block. Filled with soft blues and whites, the glass block can be used later in baby\'s room and makes a memorable baby boy gift. A baby blue ribbon weaves through white spray roses and blue delphinium in a keepsake glass baby block vase.', 'C03', '2024-01-01 02:04:51', '2024-01-01 02:04:51'),
('P41', 'images/hoa22.jpg', 'Wow Wagon - Boy', 75, 1000, 'Hitch your wagon to a star! This little red wagon is a flower arrangement and nursery decoration all in one. A top-selling baby gift, it\'s filled with bold blooms of red, yellow and white. A shiny metal wagon overflowing with flowers and greens including red miniature gerberas, yellow spray roses and daisies.', 'C03', '2024-01-01 02:06:05', '2024-01-01 02:06:05'),
('P42', 'images/hoa23.jpg', 'Wow Wagon - Girl', 75, 1000, 'Talk about the perfect welcome wagon! Available for boys and girls, this darling keepsake will be cherished for years. Bright, cheerful and ready to \"roll\" right into the nursery. Pretty yellow spray roses, red miniature gerberas and matsumoto asters, white and yellow daisy spray chrysanthemums, white button spray chrysanthemums and solidago are lovingly arranged in a wagon - the wow factor is now officially off the charts!', 'C03', '2024-01-01 02:07:30', '2024-01-01 02:07:30'),
