('P94', 'images/hoasinhnhat94.jpg', 'Light On The Water Bouquet', 79, 1000, 'As breathtaking as sunlight sparkling on a lake, this peaceful bouquet of creamy blooms and fresh greens is presented in a chic, silver glass keepsake vase. Crème roses, green carnations, green cushion spray chrystanthemums and white cushion spray chrysanthemums are arranged with bupleurum, dusty miller, lemon leaf and parvifolia eucalyptus.', 'C04', '2024-01-01 03:35:17', '2024-01-01 03:35:17'),
('P95', 'images/hoasinhnhat95.jpg', 'Mid Mod Brights Bouquet', 79, 1000, 'Talk about a bright idea! This cheerful bouquet of pink roses and peach gerberas brings joy to any occasion--especially since the lucky recipient gets to keep the chic mid-century ceramic planter! This bright bouquet features hot pink roses, peach gerberas, hot pink carnations, green cushion spray chrysanthemums, purple cushion spray chrysanthemums, and huckleberry.', 'C04', '2024-01-01 03:36:25', '2024-01-01 03:36:25'),
('P96', 'images/hoasinhnhat96.jpg', 'Colors Of The Rainbow Bouquet', 124, 1000, 'A rainbow of beauty for any occasion. Purple hydrangea, pink roses and orange lilies positively pop in this bright bouquet, featuring all the colors of the rainbow. This colorful bouquet includes purple hydrangea, pink roses, yellow spray roses, orange asiatic lilies, purple alstroemeria, blue delphinium, pink snapdragons, blue eryngium, huckleberry, oregonia, Israeli ruscus, sword fern, silver dollar eucalyptus, seeded eucalyptus, and lemon leaf.', 'C04', '2024-01-01 03:37:24', '2024-01-01 03:37:24'),
('P97', 'images/hoasinhnhat97.jpg', 'Choose Happy Bouquet', 79, 1000, 'Happiness, delivered! Colorful roses in a cheerful ceramic mug are the quickest way to turn any day into a GREAT day. Hot pink roses, orange spray roses, lavender matsumoto asters, green button spray chrysanthemums, yellow cushion spray chrysanthemums and lavender sinuata statice are arranged with huckleberry and pitta negra.', 'C04', '2024-01-01 03:38:16', '2024-01-01 03:38:16'),
('P98', 'images/hoasinhnhat98.jpg', 'Always on My Mind - Long Stemmed Red Roses', 119, 1000, 'Let her know how important she is to you with two dozen ravishingly red roses in a sparkling spring garden vase. If one dozen is classic, think of what an impression you\'ll make with two dozen of the finest roses available. Two dozen red roses are arranged with salal and pitta negra in a spring garden vase.', 'C04', '2024-01-01 03:39:02', '2024-01-01 03:39:02'),
('P99', 'images/hoasinhnhat99.jpg', 'Brilliant Birthday Blooms', 74, 1000, 'There\'s no mistaking this bouquet for anything but a Happy Birthday wish! With its colorful streamers and birthday candle design, this bright arrangement is perfect as a great party centerpiece or to send to a loved one far away. Pretty orange spray roses, red miniature carnations, yellow daisy spray chrysanthemums, purple statice and more are joined by yards of curling ribbon and delivered in a very special keepsake container. Brilliant? You bet!', 'C04', '2024-01-01 03:40:27', '2024-01-01 03:40:27');
